style.css:
@-moz-document url-prefix( https://wiki.garrysmod.com/ ) {
    .skin-garrysmod {
        background-color: #181a1b;
        background-image: none;
    }
    .withnav navigation {
        background-color: #1e2021;
        background-image: none;
    }
    .withnav navbutton {
        background-color: #1e2021;
        background-image: none;
    }
    navbutton {
        background-color: #1e2021;
        background-image: none;
    }
    table.gmodwiki_note tr td:nth-child( 1 ) {
        background: #1272c5;
    }
    table.gmodwiki_note tr td:nth-child( 2 ) {
        background: #1e2021;
    }
    table.gmodwiki_note.warning_note tr td:nth-child( 1 ) {
        background: #a0631e;
    }
    .examples_number {
        color: #d4cccb!important;
    }
    .mw-content-ltr {
        color: #cccccc;
    }
    .mw-content-ltr p {
        color: #cccccc;
    }
    .mw-content-ltr pre {
        background-color: #1e2021;
    }
    .argument {
        color: #d1d1d1;
    }
    .function_line {
        background-color: #1e2021;
        color: #cccccc;
    }
    .mw-headline {
        color: #EAE1E0;
        text-shadow: none;
    }
    .mw-headline a {
        color: #d1d1d1;
        text-shadow: none;
    }
    a {
        color: #65a3eb;
    }
    #footer {
        background-color: #1e2021;
    }
    #mw-pages h2 {
        color: #d1d1d1;
        text-shadow: none;
    }
    #mw-normal-catlinks {
        background-color: #1e2021;
    }
    #mw-normal-catlinks a {
        text-shadow: none;
    }
    #firstHeading A {
        text-shadow: none!important;
    }
    #firstHeading {
        text-shadow: none!important;
    }
    .arg_number {
        background-color: #1e2021;
    }
    .ret_number {
        background-color: #1e2021;
    }
    .wikitable {
        background-color: #d1d1d1;
    }
    .wikitable td {
        color: #dddddd;
        border-color: #222222;
    }
    .wikitable th {
        background-color: #666666;
        border-color: #1e2021;
    }
    .gmodwiki_note tr td:nth-child(2) {
        background-color: #333333;
    }
    .return {
        color: #cccccc;
    }
    .stubpage {
        background-color: #1e2021;
    }
    .stubpage span {
        color: #4096EE
    }
    .searchresult {
        color: #cccccc;
    }
    .navigation {
        background-color: #111213;
    }
}
